export const ToDoList = ({ filter, data, deleteToDo }) => {


    filteredContacts = () => {
        return data.filter(d =>
          d.name.toLowerCase().includes(filter.toLowerCase())
        );
      };




   

  return (
    <ul>
      {data.map(({ name, number ,id }) => (
        <li key={id}>
            {name} {number} 
          <button type="button" onClick={() => deleteToDo(id)}>delete</button>
        </li>
      ))}
    </ul>
    
  );
};
